import './App.css';

function Header({onChangeValue}){


    const changeUserValue = (e)=> {
        const { value } = e.target;
        onChangeValue(value);
    }

    return (

            <header className={"header"}>
                <input type="text"
                       className="search-input"
                       onChange={changeUserValue}
                />
            </header>
    )
}

export default Header;
